import React from 'react'
import { useParams } from "react-router-dom"
// import { getNote } from '../assets/data'
import notes from '../assets/data'

const NotePage = () => {
    let params = useParams()
    //let getNote = notes.find(note => note.id === id)
    function getNote(id) { notes.find(note => note.id === id) }
    let note = getNote(parseInt(params.noteId, 10));

    return (
        <div>
            <h2>{note.body}</h2>
        </div>
    )
}

export default NotePage
